import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <center className='header'>
      <div className="nav-area">
        <Link to="/" className="logo">
          Digichola
        </Link>
        <Navbar />

      </div>
    </center>
  );
};

export default Header;
